window.bookSummaryJSON = "<p>Aileen has a few rules for her life. Do her job and go home safe. Keep the supernatural world away from her human family. Stay off the vampire radar. And, above all, don't get involved in spook politics.</p> <p>But when Liam comes back into town bringing a mystery that threatens the life she's built, she finds every closely guarded rule flying out the window as she sinks ever deeper into the supernatural world.</p> <p>Ultimately, it may be the people she loves the most who pay the price in the high-stakes game that vampires call life.</p>"; 
